//https://github.com/vakhtang/react-search-bar/tree/master/src/components
import data from "../../mocks/postData.json";

export default function Posts(props) {
  return (
    <ul>
      {data.map((item) => {
        <li key={item.id}>{item.key}</li>;
      })}
    </ul>
  );
}
